tables.table_schema:
CREATE TABLE EnergyGeneration (
    location_id INT,
    date DATE,
    solar_generation FLOAT,
    wind_generation FLOAT
);

CREATE TABLE weather_data (
    location_id INT,
    date DATE,
    temperature DECIMAL,
    precipitation DECIMAL
);

CREATE TABLE energy_generation (
    location_id INT,
    date DATE,
    energy_generation DECIMAL,
    capacity DECIMAL
);

CREATE TABLE energy_utilization (
    location_id INT,
    date DATE,
    energy_utilization DECIMAL,
    utilization_rate DECIMAL
);

CREATE TABLE energy_forecast (
  date DATE,
  solar_generation INT,
  wind_generation INT,
  total_energy INT
);

CREATE TABLE energy_utilization (
  date DATE,
  energy_consumed INT,
  energy_produced INT,
  net_energy INT
);

CREATE TABLE forecast_accuracy (
  date DATE,
  solar_accuracy DECIMAL(5, 2),
  wind_accuracy DECIMAL(5, 2),
  overall_accuracy DECIMAL(5, 2)
);
